import logo from './logo.svg'
import './App.css'
import Home from './pages/Home';
import Enter from './pages/Enter';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

function App() {
  return(
    <BrowserRouter>
      <div className="App">
        <Switch>
          <Route path='/'>
            <Home/>
          </Route>
        </Switch>
      </div>

    </BrowserRouter>
  )
}

export default App;
